function searchVideo(keyword) {
  const APIkey = "AIzaSyAtTWostq1MsBKVBHh6HeQ2bX6y6xj8YyE";
  const url = `https://youtube.googleapis.com/youtube/v3/search?part=snippet&maxResults=15&q=${keyword}&type=video&key=${APIkey}`;
  fetch(url)
    .then((response) => {
      connsole.log(response);
      if (!response.ok)
        throw new Error(`Videos not Found ${response.json().message}`);
      return response.json();
    })
    .then((data) => {
      console.log(data);
    })
    .catch((error) => {
      console.log(error);
    });
}

export default searchVideo;
